import React from 'react'
import {SuperSubgrid2, Button, Head,Desc } from './Service.elements';
function Component(props) {
    const descriptionMotion = {
        rest: {
          opacity:1,
            y: 0,
          transition: {
           opacity:0
          }
        },
        hover: {
         opacity:0,
          y: 0,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      
      const logoMotion = {
        rest: { opacity: 1,y:20, duration:0.8, type: "tween", ease: "easeIn" },
        hover: {
          opacity: 0,
          y:-30,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      const headingMotion = {
        rest: { opacity: 0.6,y:30, ease: "easeOut", duration: 0.2, type: "tween" },
        hover: {
          opacity: 1,
          y:-20,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
    return (
       
                <SuperSubgrid2 initial="rest" whileHover="hover" animate="rest">
             {props.icon}
             <Head variants={logoMotion} >{props.head}</Head>
             <Button variants={descriptionMotion}>Learn More</Button>
             <Desc variants={headingMotion}>{props.desc}</Desc>
                </SuperSubgrid2>

    )
}

export default Component
